pragma solidity ^0.8.7;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./User.sol";
import "./Employee.sol";
import "./Tenant.sol";

contract Consorcio is Ownable {

    struct Service {
        string service;
        uint price;
    }

    address private admin;
    Employee public aEmployee;
    Tenant public aTenant; 

    /* modifier adminPermission(address _admin) public view {
        require()
    } */

    receive() external payable {}
    fallback() external payable {}

    Service[] private services;

    function addUser(User _user) public onlyOwner {
    }

    function getBalance() public view returns (address, uint) {
        return (address(this), address(this).balance);
    }

    function payServices(address _employee) public payable onlyOwner {
        
    }


}

challenges/Consorcio/Tenant.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "./User.sol";

contract Tenant is User {

    uint private contractPeriod;
    uint private aptAddress;
    address private consorcioAddress;

    constructor(
        uint newId,
        address newAddress,
        uint newContractPeriod,
        uint newAptAddress,
        address newConsorcioAddress
    ) payable User(newId, newAddress) {
        contractPeriod = newContractPeriod;
        aptAddress = newAptAddress;
        consorcioAddress = newConsorcioAddress;
    }

    function deposit() public payable {}

}

challenges/Consorcio/Employee.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "./User.sol";

contract Employee is User {

    string private proffession;
    string private schedule;
    uint private salary;

    constructor(
        uint newId,
        address newAddress,
        string memory newProffession,
        string memory newSchedule,
        uint newSalary
    ) User(newId, newAddress) {
        proffession = newProffession;
        schedule = newSchedule;
        salary = newSalary;
    }
}

challenges/Consorcio/User.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

abstract contract User {

    uint public id;
    address public withdrawalAddress;

    receive() external payable {}
    fallback() external payable {}

    constructor(uint newId, address newAddress) {
        id = newId;
        withdrawalAddress = newAddress;
    }

}

